script: |
  super -f text -I q353.spq | sort > q353.out

inputs:
  - name: q353.spq
    data: |
      SELECT DISTINCT - 59 + col2 * - ( ( + col1 ) ) AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( 79 ) BETWEEN 35 AND col1;
  - name: tab1

outputs:
  - name: q353.out
    data: |
      -1403
      -3255
      -354
